import React from "react";
import { Route, Link } from "react-router-dom";
import "./App.css";
import Actors from "./Actors";
import Ideas from "./Ideas";
import Notes from "./Notes";

function App() {
  return (
    <div>
      <nav>
        <Link to="/">Actors</Link>
        <Link to="/ideas">Movie-Ideas</Link>
        <Link to="/notes">Movie-Notes</Link>
      </nav>
      <Route path="/" exact>
        <Actors />
      </Route>
      <Route path="/ideas">
        <Ideas />
      </Route>
      <Route path="/notes">
        <Notes />
      </Route>
    </div>
  );
}

export default App;
